import React from 'react'
import CreateNode from './CreateNode'
import { Component } from 'react'
import Node from './Node'

const CreateGrid=()=>{
    var temp=[],Grid=[]
    for (var i=0;i<4;i++){
        for(var j=0;j<4;j++)
        {
            temp[j]= <Node  
            col={i}
            isFinish={false}
            isStart={false}
            isWall={false}
            /*onMouseDown,
            onMouseEnter,
            onMouseUp,*/
            row={j}
            />
        }
        Grid[i]=temp

    }
    console.log(Grid[2][3])
    return(
        Grid
    )
};
export default CreateGrid;
